import React from "react";
import { Calendario } from "./style";


function OrganizarSemana(diaSemana: any) {
  let domingo: any = [];
  diaSemana.forEach((element: string) => {
    domingo.push(<div>{element}</div>);
  });
  console.log(domingo);
  return domingo;
}

function Card(dias: any) {
  let domingo: any;

  return (
    <>
      <Calendario>
        {OrganizarSemana(dias.dias.domingo)}
      </Calendario>
    </>
  );


}

export default Card;
